import { createReducer, on } from '@ngrx/store';
import { setItems, unSetItems } from './ingreso-egreso.actions';
export const initialState = {
  items: []
};
export const ingresoEgresoReducer = createReducer(initialState, on(setItems, (state, {
  items
}) => ({
  ...state,
  items: [...items]
})), on(unSetItems, state => ({
  ...state,
  items: []
})));
